snippet.description:
In:Finity, an expansion for Calmed by the Dark Leviathan, will be released on August 27.

#Steam: https://store.steampowered.com/app/1676260/Calmed_by_the_Dark_Leviathan/

Set XXXX years in the future, a woman wake up in a cyber world, with no humans in sight, she begins her quest to search for other survivors and understand what is happening in this new reality .

Explore dungeons, collect monsters and uncover what happened to mankind in In:Finity.

| A dark connected  world;
| Upgrade your character for higher survival chances;
| +20 monsters to battle and collect;
| Turn based combat;
| Multiple endings.

